Transactions represent several function call invocations that are atomic. If any function call fails, the entire tx is rejected. Additionally some smart contracts might impose additional conditions on the transaction's structure or other function calls (such as their call data). /// A Transaction contains an arbitrary number of `ContractCall` objects,
/// along with corresponding ZK proofs and Schnorr signatures.
#[derive(Debug, Clone, Default, Eq, PartialEq, SerialEncodable, SerialDecodable)]
pub struct Transaction { /// Calls executed in this transaction pub calls: Vec<ContractCall>, /// Attached ZK proofs pub proofs: Vec<Vec<Proof>>, /// Attached Schnorr signatures pub signatures: Vec<Vec<Signature>>,
} Function calls represent mutations of the current active state to a new state. /// A ContractCall is the part of a transaction that executes a certain
/// `contract_id` with `data` as the call's payload.
#[derive(Debug, Clone, Eq, PartialEq, SerialEncodable, SerialDecodable)]
pub struct ContractCall { /// ID of the contract invoked pub contract_id: ContractId, /// Call data passed to the contract pub data: Vec<u8>,
} The contract_id corresponds to the top level module for the contract which includes the global State. The func_id of a function call corresponds to predefined objects in the submodules: Builder creates the anonymized CallData. Ran by the prover. CallData is the parameters used by the anonymized function call invocation. Verifiers have this. state_transition() that runs the function call on the current state using the CallData. apply() commits the update to the current state taking it to the next state. An example of a contract_id could represent DAO or Money. Examples of func_id could represent DAO::mint() or Money::transfer(). Each function call invocation is ran using its own state_transition() function. mod dao_contract { ... // DAO::mint() in the smart contract pseudocode mod mint { ... fn state_transition(states: &StateRegistry, func_call_index: usize, parent_tx: &Transaction) -> Result<Update> { // we could also change the state_transition() function signature // so we pass the func_call itself in let func_call = parent_tx.func_calls[func_call_index]; let call_data = func_call.call_data; // It's useful to have the func_call_index within parent_tx because // we might want to enforce that it appears at a certain index exactly. // So we know the tx is well formed. ... } }
} The state_transition() has access to the entire atomic transaction to enforce correctness. For example chaining of function calls is used by the DAO::exec() smart contract function to execute moving money out of the treasury using Money::transfer() within the same transaction. Additionally StateRegistry gives smart contracts access to the global states of all smart contracts on the network, which is needed for some contracts. Note that during this step, the state is not modified. Modification happens after the state_transition() is run for all function call invocations within the transaction. Assuming they all pass successfully, the updates are then applied at the end. This ensures atomicity property of transactions. mod dao_contract { ... // DAO::mint() in the smart contract pseudocode mod mint { ... // StateRegistry is mutable fn apply(states: &mut StateRegistry, update: Update) { ... } }
} The transaction verification pipeline roughly looks like this: Loop through all function call invocations within the transaction: Lookup their respective state_transition() function based off their contract_id and func_id. The contract_id and func_id corresponds to the contract and specific function, such as DAO::mint(). Call the state_transition() function and store the update. Halt if this function fails. Loop through all updates Lookup specific apply() function based off the contract_id and func_id. Call apply(update) to finalize the change.

